import { Component } from '@angular/core';

@Component({
  selector: 'app-teachers',
  template: `
        <ul>
          <li  *ngFor="let teacher of teachers">
            <a routerLink="/teachers/teacher.id"><h3>{{teacher.id}}{{teacher.name}}</h3></a>
          </li>
        </ul>
  `,
  styles: []
})
export class TeachersComponent {

  teachers = [
    { 'id' : 1 , name : 'Anto'},
    { 'id' : 2 , name : 'Ramkumar'},
    { 'id' : 3 , name : 'naveen'}
  ]
}
